export const getCountyForCity = (city, stateCode) => {
  if (!city || !stateCode) return null;
  const normalizedCity = city.toLowerCase().trim().replace(/'/g, '');
  const upperStateCode = stateCode.toUpperCase();
  const stateMap = CITY_TO_COUNTY_BY_STATE[upperStateCode];
  if (!stateMap) return null;
  return stateMap[normalizedCity] || null;
};
